#### TypeScript SDK Code Sample

```typescript
import { createClient } from 'liferay-headless-rest-client';
import { getCountry } from 'liferay-headless-rest-client/headless-admin-address-v1.0';

const client = createClient({
    baseUrl: 'http://localhost:8080',
    headers: {
        Authorization: `Basic ${btoa("test@liferay.com:test")}`,
    },
});

async function main() {
    const { data } = await getCountry({
        client,
        path: {
           countryId: "697",
        },
    });

    console.log(data);
}
```
